const freshRolls = [
  {
    id: 1,
    name: "Yellowtail Delight Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  },
  {
    id: 2,
    name: "Hawaiian Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  },
  {
    id: 3,
    name: "Cucumber Sashimi Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  },
  {
    id: 4,
    name: "Sakura Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99
  }
];

export default function FreshRolls() {
  return (
    <>
      {freshRolls.map(freshRoll => (
        <Grid item xs={12} sm={6}>
          <CardItem
            key={freshRoll.id}
            itemName={{ text: `${freshRoll.name}` }}
            itemDescription={{ text: `${freshRoll.description}` }}
          ></CardItem>
        </Grid>
      ))}
    </>
  );
}
